#ifdef CNN_TEST

#include <stdio.h>
#include <sys/time.h>

int current_time_micro() {
  struct timeval time;
  gettimeofday(&time, NULL);

  return time.tv_sec * 1000000 + time.tv_usec;
}

int main()
{
    const int IN_DIM = 14400;
    const int OUT_DIM = 490;
    const int NUM_RUNS = 100;

    int timings[NUM_RUNS] = {};

    alignas(16) float in[IN_DIM];
    alignas(16) float out[OUT_DIM];

    // read image
    FILE *f = fopen("img.bin", "r");
    fread(&in, sizeof(float), IN_DIM, f);

    int total_elapsed = 0;

    for (int run = 0; run < NUM_RUNS; run++)
    {
        // reset out
        for (size_t i = 0; i < OUT_DIM; i++)
        {
            out[i] = 0.0f;
        }

        // declare variables
        int st, et;

        // run function
        st = current_time_micro();
        cnn(in, out);
        et = current_time_micro();
        int elapsed = et - st;
        timings[run] = elapsed;
        total_elapsed += elapsed;
    }

    printf("values:");
    for (int i = 0; i < OUT_DIM; i++)
    {
        printf(" %f", out[i]);
    }
    printf("\n");

    printf("timings:");
    for (int i = 0; i < NUM_RUNS; i++)
    {
        printf(" %d", timings[i]);
    }
    printf("\n");

    printf("time: %d micro seconds\nruns: %d\naverage: %d micro seconds/run\n", total_elapsed, NUM_RUNS, total_elapsed/NUM_RUNS);

    return 0;
}

#endif